import React from "react";
import { StyleSheet, Text, TextInput, View } from 'react-native';

const Feed = () => {
    return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
            <Text>Feed de noticias</Text>
            <TextInput />
        </View>

    );
};

export default Feed;
